export default quoteData = [
    {
        quote: 'No matter what happens in life, be good to people. Being good to people is a wonderful legacy to leave behind.'
    },
    {
        quote: 'We don\'t need to share the same opinions as others, but we need to be respectful.'
    },
    {
        quote: 'I think the perfection of love is that it\'s not perfect.'
    }
]
